import React from "react";
import "../styles/Footer.css";

const Footer = () => {
  return (
    <div>
      <div className="footer-container">
        <div className="footer-info">
          <p>
            <a
              target="_blank"
              rel="noreferrer"
              href="https://goo.gl/maps/9hy8zLpiVS9EjkpJ7"
            >
              Lenaria
            </a>{" "}
            Web Design & Development
          </p>
        </div>
      </div>
    </div>
  );
};

export default Footer;
